import './App.css';
import {Routes, Route, Switch} from "react-router-dom";
import Login from "./Login/Login";
import Register from "./Register/Register";

function App() {
  return (
    <div className="App">
        <Routes>
            <Switch>
                <Route path="/" element={<Login />} />
                <Route path="/register" element={<Register />} />
            </Switch>


        </Routes>
    </div>
  );
}

export default App;
